import React from 'react';
import Person from './Result/Result';

const results = (props) => (
    props.persons.map((result, index) => {
        return <Person
            key={person.id}
            click={() => props.clicked(index)}
            name={person.name}
            age={person.age}
            changed={(event) => props.changed(event, person.id)} />
    })
);

export default results;
